let div = document.querySelector('div');
let li  = Array.from(document.querySelectorAll('li'));
let body = document.getElementById('app');

let div2 = document.getElementById('section_2');

console.log(li);

div.style.border = "2px solid red";

// nodeList, htmlCollection

li.map((element)=>{
    console.log(element);
    element.style.fontWeight = "bold";
    element.style.color = "green";
    element.style.listStyleType = "none"
    element.style.display = "inline-block";
})

let button = document.createElement("button");
button.innerText = "Click Me";
button.id = "btn";
button.className = "click-button"

body.appendChild(button);

console.log(button);

// appendChild - add element at the end of the parent element
// removeChild- it removes the child element from the parent element
// replaceChild, insertBefore, insertAfter

let image = document.createElement("img");
image.src = "data:image/jpeg;base64,";
image.alt = "image";


div2.appendChild(image);
console.log(image);


